import React, { useRef } from 'react';
import classes from './Identety.module.css';
import { useHistory } from 'react-router';
const Identety = () => {
  const history = useHistory();
  const nameInputRef = useRef();
  const ageInputRef = useRef();
  const hobbyInputRef = useRef();

  const submitHandeler = (e) => {
    e.preventDefault();
    const entredName = nameInputRef.current.value;
    const entredAge = ageInputRef.current.value;
    const entredHobby = hobbyInputRef.current.value;

    fetch('https://pro-crew-52de7-default-rtdb.firebaseio.com/identety.json', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        Name: entredName,
        Age: entredAge,
        Hobby: entredHobby,
      }),
    })
      .then((res) => res.json())
      .then((data) => console.log(data));

    history.replace('/Thank');
  };

  return (
    <section className={classes.box}>
      <div>
        <p>May You Tell Me More About Your Self</p>
      </div>
      <form className={classes.control} onSubmit={submitHandeler}>
        <div>
          <label>Your Name: </label>
          <input type='text' ref={nameInputRef}></input>
        </div>
        <div>
          <label>Your Age: </label>
          <input type='text' ref={ageInputRef}></input>
        </div>
        <div>
          <label>Your Hobbies: </label>
          <input type='text' ref={hobbyInputRef}></input>
        </div>
        <div className={classes.actions}>
          <button type='submit'>Subbmit</button>
        </div>
      </form>
    </section>
  );
};

export default Identety;
